import {NavBar, NavBarLinksProps, NavBarLinkProps, NavBarLogoProps, Container} from 'reactwiind';
import { ComponentProps, FC, ReactNode } from 'react';
 
export interface WingoHeaderProps extends NavBarLinksProps  {
  logo: NavBarLogoProps
}
 
export const  WingoHeader:FC<WingoHeaderProps> = ({links, logo}) => {
  return   <NavBar>
              <NavBar.Logo {...logo}>{logo as ReactNode}</NavBar.Logo>
              <NavBar.Collapse>
                <NavBar.Links links={links} />
              </NavBar.Collapse>
          </NavBar>
         
}